        const red = Math.round(255 * swipeRatio);
        const green = 0; 
        const blue = 0; 
        const alpha = 1; 


        if (Math.abs(deltaX) <= 100) {
            return 'linear-gradient(to bottom right, rgb(235, 233, 233) 50%, rgb(4, 52, 85))'
        } else{
        return `rgba(${red}, ${green}, ${blue}, ${alpha})`
    }
